cuga	Cumberland Gap National Historical Park	At Cumberland Gap, the first great gateway to the west, follow the buffalo, the Native American, the longhunter, the pioneer... all traveled this route through the mountains into the wilderness of Kentucky. Modern day explorers and travelers stand in awe at this great gateway and the many miles of trails and scenic features found in the park.	National Historical Park	KY,TN,VA	36.62503076	-83.6114083	By Plane The closest major airport is located in Knoxville, Tennessee approximately 85 miles away. Flights can also be made into Lexington, Kentucky approximately 130 miles away. By Car The park entrance is located on Highway 25E just south of Middlesboro Kentucky.	Summers at Cumberland Gap are hot and humid, with temperatures commonly in the mid to upper 90s. Winters are generally mild with rain and some periods of snow January through March. Temperatures usually range in the 30s and 40s. Weather can sometimes be unpredictable, especially at higher elevations.	0.00	There are no entrance fees at Cumberland Gap National Historical Park.	\N	\N
