cure	Curecanti National Recreation Area	Curecanti National Recreation Area is a series of three reservoirs along the once wild Gunnison River. The reservoirs that make up Curecanti today are a destination for water-based recreation high in the Rocky Mountains. Best known for salmon and trout fishing, Curecanti also offers opportunities for hiking, boating, camping, and bird watching.	National Recreation Area	CO	38.46584558	-107.3303371	U.S. Highway 50 runs the length of Curecanti between Montrose and Gunnison. The recreation area is also accessed from CO Highway 149 and CO Highway 92.	Weather can vary greatly throughout the day. Summer daytime temperatures range between 50 to 90F (10 to 32C), nights 40 to 60F (4 to 15C). Winter daytime temperatures range between -20 to +40F (-29 to +4C), nights -30 to +20F (-34 to -7C). Precipitation is minimal, but afternoon thunderstorms and strong winds are common during the summer. Snow accumulation varies greatly year to year. Layered clothing appropriate for the season is recommended.	0.00	There is no entrance fee for Curecanti. Visitors traveling to East Portal through the Black Canyon of the Gunnison National Park entrance must pay $30.00 per vehicle. It covers all persons in a single, private, noncommercial vehicle and is valid for seven calendar days.	\N	\N
cuva	Cuyahoga Valley National Park	Though a short distance from the urban areas of Cleveland and Akron, Cuyahoga Valley National Park seems worlds away. The park is a refuge for native plants and wildlife, and provides routes of discovery for visitors. The winding Cuyahoga River gives way to deep forests, rolling hills, and open farmlands. Walk or ride the Towpath Trail to follow the historic route of the Ohio & Erie Canal.	National Park	OH	41.26093905	-81.57116722	Plane Cleveland Hopkins International Airport and Akron-Canton Regional Airport offer many daily flights to the area. Car rentals are available at both airports. Bus & Train Bus stations are located in downtown Cleveland and Akron. The Amtrak station is in downtown Cleveland. Car The park is easily accessible by car from all directions. A good place to start your visit is at Boston Mill Visitor Center located at 6947 Riverview Road, Peninsula, Ohio 44264. (41° 15'45.3" N) (81° 33'37.3" W).	Spring's rain and warming temperatures bring new leaves on trees, blooming wildflowers, and visitors anxious get out on the trail. Summer temperatures range from 49 to 95 degrees F and can be humid. Dressing in layers is advisable. Fall temperatures can range from low 70s during the day to freezing during the night. Fall foliage often peaks in mid-October. Winter weather conditions can rapidly change due to the lake effect snow from Lake Erie. Temperatures vary from mid-30s to below zero.	0.00	There is no entrance fee.	\N	\N
