daav	Dayton Aviation Heritage National Historical Park	Three exceptional men from Dayton, Ohio, Wilbur Wright, Orville Wright and Paul Laurence Dunbar, found their creative outlet here through accomplishments and failures, and finally success. However, these men offered the world something far greater, they offered the world hope, and the ability to take a dream and make it a reality.	National Historical Park	OH	39.78944467	-84.10442045	Located in west-central Ohio, the park is easily accessible via I-70, I-75 or US Route 35. The main park visitor center, Wright Dunbar Interpretive Center, is located at S. Williams St. and W. Third St. in Dayton.	The park lies in a humid continental zone with a generally temperate climate. Winters are mildly cold with average temperatures around 39 degrees (F). Summers are hot and humid with an average temperature around 74 degrees (F). Average annual total rainfall is just above 41". Snowfall in the winter is generally light with an average total snowfall of about 25".	0.00	There are no entrance fees to Dayton Aviation Heritage National Historical Park	\N	\N
