iafl	Ice Age Floods National Geologic Trail	At the end of the last Ice Age, 18,000 to 15,000 years ago, an ice dam in northern Idaho created Glacial Lake Missoula that stretched 3,000 square miles into Montana. The dam burst and released flood waters across Washington, down the Columbia River, back flooding into Oregon, before reaching the ocean. This happened perhaps a 100 times and changed the lives and landscape of the Pacific Northwest.	National Geologic Trail	WA,OR,ID,MT	46.5669309007871	-118.992564971161	To Trail Headquarters from Spokane Take I-90 West At Exit 277, merge onto US-2 toward Davenport/Fairchild AFB/Spokane Airport Just past Wilbur, turn right onto WA-21 Stay left onto Highway 174 Turn right onto WA-155 Stay on WA-155 past Grand Coulee Dam and into the town of Coulee Dam Cross the Columbia River and continue on WA-155 Turn right onto Crest Drive and follow up the hill. The HQ Office is located on the left	The National Geologic Trail is a collection of sites stretched across a four state area, the weather will vary from site to site. Please check the weather for your local region, or the region you'll be visiting, through their respective sites.	0.00	The National Geologic Trail it is a collection of sites operated by a variety of partners across a four state area. Hours of operation and entrance fees will vary from site to site. Please check each respective site for more details and information.	\N	\N
jomu	John Muir National Historic Site	John Muir played many roles in his life, all of which helped him succeed in his role as an advocate for Nature. As America’s most famous naturalist and conservationist, Muir fought to protect the wild places he loved, places we can still visit today. Muir’s writings convinced the U.S. government to protect Yosemite, Sequoia, Grand Canyon and Mt. Rainier as national parks.	National Historic Site	CA	37.9828422	-122.1326097	Please visit our main website for specific directions to our park. You may call the John Muir Visitor Center for additional information.	The Mediterranean climate of Martinez features hot, dry summers with lower temperatures near 60º F and upper temperatures near 100º F. The heat gives way to cool, rainy winters with lows near 45º F and highs near 75º F. Fall and spring can bring rain and temperatures from 55-80º F. March to April: wet/dry, 60-80º F May to September: very dry, 60-100º+ F October to November: dry/wet, 55-80º F December to February: wet, 45-75º F	0.00	The John Muir National Historic Site and Mount Wanda are free to visit.	\N	\N
iatr	Ice Age National Scenic Trail	A mere 15,000 years ago during the Ice Age, much of North America lay under a huge glacier. Mammoths, saber tooth cats and cave lions roamed the earth! Some of the best evidence of this glacier is found in Wisconsin such as the state’s many lakes, river valleys, gently rolling hills, and ridges. The nearly 1,200 mile Ice Age National Scenic Trail, established in 1980, traces the glacier's edge.	National Scenic Trail	WI	43.9895697794196	-89.5612021705858	The Ice Age National Scenic Trail stretches nearly 1,200 miles across Wisconsin. Plane Commercial airports are located in major cities and regional communities throughout the state at varying distances from the Ice Age National Scenic Trail. Car Numerous trailheads with parking are located throughout the state.	Wisconsin has four distinctly different seasons. Wisconsin's continental climate means this state enjoys a little bit of everything, weather-wise. Summers are generally warm and pleasant, while the area is covered with a thick blanket of white snow in winter.	0.00	The NPS does not charge a fee to enjoy the Ice Age National Scenic Trail, Some public lands such as state and county parks located along the Trail may charge entrance fees. Camping registration, permits, and fees may also be needed. Before your visit you should check with the local land manager regarding possible fees and registration requirements.	\N	\N
inde	Independence National Historical Park	The park represents the founding ideals of the nation, and preserves national and international symbols of freedom and democracy, including Independence Hall and the Liberty Bell. The Declaration of Independence and U.S. Constitution were both debated and signed inside Independence Hall, a UNESCO World Heritage Site.	National Historical Park	PA	39.94746112	-75.14794157	Independence National Historical Park is located in an urban area served by Interstates 95 and 676. The park is also easily accessible by public transportation, including SEPTA and PATCO mass transit routes. Whether you choose driving, the bus or the train, we recommend that you start your visit at the Independence Visitor Center at 6th and Market Streets. See the park's website for specific directions.	Summers are typically hot and muggy, fall and spring are generally mild, and winter is cold. Snowfall is highly variable, with some winters bringing only light snow and others bringing several major snowstorms, with the normal seasonal snowfall standing at 22.4 in (57 cm). Precipitation is generally spread throughout the year, with eight to twelve wet days per month.	1.00	Entrance to the Liberty Bell Center and most other park sites is free. Entrance to Independence Hall is by timed, ticketed tour only.  There is a $1.00 per ticket service fee. The Benjamin Franklin Museum charges an interpretive fee.	\N	\N
indu	Indiana Dunes National Park	Indiana Dunes National Park hugs 15 miles of the southern shore of Lake Michigan and has much to offer. Whether you enjoy scouting for rare species of birds or flying kites on the sandy beach, the national park's 15,000 acres will continually enchant you. Hikers will enjoy 50 miles of trails over rugged dunes, mysterious wetlands, sunny prairies, meandering rivers and peaceful forests.	National Park	IN	41.63765525	-87.09647445	Visitors can access the national park via Interstate 94, the Indiana Toll Road (Interstate 80/90), U.S. Highway 12, U.S. Highway 20, Indiana State Road 49, and various other local roads. The Indiana Dunes Visitor Center is located on Indiana State Road 49, between U.S. Highway 20 and Interstate 94 (1215 North State Road 49, Porter, IN 46304). For a driving map to the Indiana Dunes Visitor Center or other locations, check out our maps page.	On average, the warmest month is July and the highest recorded temperature was 105F in 1934. The coolest month is January, with the lowest recorded temperature of -25F in 1985. June sees the most precipitation with an average rainfall of 4.66 Inches.	6.00	This expanded amenity fee provides entry for one (1) vehicle.  The fee helps maintain the bathhouse and lifeguards during the peak season. *Fee is collected daily from the Friday of Memorial Day weekend through the Monday of Labor Day weekend, 8:00 am to as late as 7:00 pm Central Time.	\N	\N
isro	Isle Royale National Park	Explore a rugged, isolated island, far from the sights and sounds of civilization. Surrounded by Lake Superior, Isle Royale offers adventures for backpackers, hikers, boaters, kayakers, canoeists and scuba divers. Here, amid stunning scenic beauty, you'll find opportunities for reflection and discovery, and make memories that last a lifetime.	National Park	MI	48.01145819	-88.82780657	Isle Royale National Park headquarters is located in Houghton, MI. Visit the Houghton page on the Isle Royale National Park website for additional information and a map on how to access the visitor center.	Isle Royale National Park is a remote island wilderness in the middle of Lake Superior. Weather influences traveling to and from the island, as well as your trip once you arrive. For the most up-to-date weather information, call (906) 482-0984 or email isro_parkinfo@nps.gov prior to your trip.	7.00	The daily entrance fee is  $7 per person. It is charged to enter or remain within the park per calendar day (it includes the day you arrive and the day you depart the park). Pay this fee after your transportation reservations have been confirmed. \n\nAll Federal Recreation Passes (Annual, Senior, Access, Military) are honored. Entrance fees will be waived for the pass holder and up to 3 adults traveling with the pass holder.\n\nChildren ages 15 and under are exempt from paying entrance fees.	\N	\N
inup	Iñupiat Heritage Center	On the rooftop of the world, the Iñupiat Heritage Center in Barrow, Alaska, tells the story of the Iñupiat people. They have thrived for thousands of years in one of the harshest climates on Earth, hunting the bowhead, or "Agviq." In the 19th century, these lonely seas swarmed with commercial whalemen from New England, who also sought the bowhead for its valuable baleen and blubber.		AK	71.29832445	-156.7535863	The Inupiat Heritage Center is located in Barrow, Alaska, the largest city in the North Slope Borough and the northernmost city in the United States. Barrow can be reached via commercial and charter flights from Anchorage and Fairbanks.	Owing to its location 320 miles (515 km) north of the Arctic Circle, Barrow's climate is cold and dry, classified as a polar climate (Köppen ET). Winter weather can be extremely dangerous because of the combination of cold and wind, while summers are cool even at their warmest.	10.00	Adults (Age 18-59)	\N	\N
