jaga	James A Garfield National Historic Site	A front porch can serve many purposes. For some, it is a place to enjoy the breeze on a warm summer night. For others, a perch from which to keep eyes on what's happening in their neighborhood. In 1880, James Garfield used his front porch as a platform to greet thousands of well-wishers during his presidential campaign. Today, the porch serves as a gateway to the story of the Garfield family.	National Historic Site	OH	41.66486549	-81.35086557	From Interstate 90 - exit at Route 306 and head north to Route 20. East on Route 20 about 1.5 miles. Site is on north side of Mentor Avenue. From Route 2 - exit at Route 306 and head south to Route 20. East on Route 20 about 1.5 miles. Site is on the north side of Mentor Avenue.	Winter tends to be cold with snow and ice from January - early March. Summers are comfortable, but can be humid and reach into the 90's. There is a 100 yard walk between the Visitor Center and Garfield home; visitors are advised to check weather conditions prior to their visit.	10.00	Visitors 16 years and above are $10/person. The entrance fee allows each visitor to take a guided tour of the Garfield Home. Reservations are now required for guided tours. Group size per tour is limited to 7 visitors per every hours from 10:15 a.m. to 4:15 p.m. Please call the site at (440) 255-8722 to reserve your tour beginning June 1, 2021.	\N	\N
