jica	Jimmy Carter National Historical Park	Few U.S. Presidents have had such close ties with where they were born and raised. The rural southern culture of Plains, Georgia, that revolves around farming, church and school, had a large influence in molding the character and in shaping the political policies of the 39th President of the United States.	National Historical Park	GA	32.03611	-84.3924	In Americus take US 280W/ W Forsyth St. until it becomes US-19 S/US-280 W/S Martin Luther King Blvd. Turn left and go .08 mile. Turn right onto US-280 W and travel 8.9 miles. Turn right onto North Bond Street/ Hwy 45 North. Plains High School will be on the right side of the road 500 feet from the intersection.	Weather in Southwest Georgia can change in the blink of an eye during the summer months. Thunderstorms and high temperatures can make it unpleasant for visitors. Check the local forecast and dress appropriately.	0.00	The Jimmy Carter National Historic Site consists of three locations: Plains High School Visitor Center, Plains Depot, and The Jimmy Carter Boyhood Farm. All locations are fee free.	\N	\N
