jofl	Johnstown Flood National Memorial	The South Fork dam failed on Friday, May 31, 1889 and unleashed 20,000,000 tons of water that devastated Johnstown, PA. The flood killed 2,209 people but it brought the nation and the world together to aid the "Johnstown sufferers." The story of the Johnstown Flood reminds us all, "...that we must leave nothing undone for the preservation and protection of our brother men."	National Memorial	PA	40.34584534	-78.77448601	Take US Route 219 to the St Michael/Sidman exit. At the end of the exit ramp head East on PA 869 (there is a park sign at the end of the exit ramp). Travel approximately 1.5 miles on PA 869 watching for a left turn onto Lake Road at the sign for Johnstown Flood National Memorial. Follow Lake Road 1.5 miles until the visitor center appears on your right. Please park safely in the designated parking lot and not block any emergency access roads.	Winters can be cold and severe. Spring can be seasonable and wet. Summer can be hot with potentials for thunderstorms. Fall can be seasonal, with cold temperatures into October and November.	0.00	Admission is free to visit the Johnstown Flood National Memorial, as well as all five Western Pennsylvania National Parks.	\N	\N
jotr	Joshua Tree National Park	Two distinct desert ecosystems, the Mojave and the Colorado, come together in Joshua Tree National Park. A fascinating variety of plants and animals make their homes in a land sculpted by strong winds and occasional torrents of rain. Dark night skies, a rich cultural history, and surreal geologic features add to the wonder of this vast wilderness in southern California. Come explore for yourself.	National Park	CA	33.91418525	-115.8398125	From I-10, take exit 117 for CA Hwy 62 toward 29 Palms/Yucca Valley. This will allow you to access the West Entrance, the North Entrance, Black Rock, and Indian Cove. Take exit 168 off I-10 to come in at the park's South Entrance.	Days are typically clear with less than 25% humidity. Temperatures are most comfortable in the spring and fall, with an average highs around 85°F (29°C) and average lows around 50°F (10°C) respectively. Winter brings cooler days, around 60°F (15°C), and freezing nights. It occasionally snows at higher elevations. Summers are hot, over 100°F (38°C) during the day and not cooling much below 75°F (24°C) at night.	30.00	7-day vehicle permit, admitting the passengers of a single, non-commercial vehicle on the day of purchase and for the next six days.	\N	\N
