kala	Kalaupapa National Historical Park	When Hansen's disease (leprosy) was introduced to the Hawaiian Islands, King Kamehameha V banished all afflicted to the isolated Kalaupapa peninsula on the north shore of Molokai. Since 1866, more than 8000 people, mostly Hawaiians, have died at Kalaupapa. Once a prison, Kalaupapa is now refuge for the few remaining residents who are now cured, but were forced to live their lives in isolation.	National Historical Park	HI	21.1731108	-156.9511609	Kalaupapa is an extremely isolated place, surrounded on three sides by ocean and two-thousand foot cliffs on the fourth. Consequently, there is no road access into the peninsula. Kalaupapa cannot be reached by automobile. To get to the park, visitors must travel by air, mule, or on foot. See the park's Direction and Transportation webpage for additional information.	Hawaii enjoys warm temperatures year-round, although site conditions at the park can vary depending on weather and time of year. The rainy season is in the winter with the more hot and humid days in the summer. Trade winds are fairly constant and typically blow from the northeast. Daytime temperatures range from 65–75° F in the winter to 80-90°F in the summer. Nighttime temperatures are often in the 60-70°F range.	0.00	The National Park Service does not charge any entrance fees for admission to Kalaupapa National Historical Park. All visitors to Kalaupapa can make reservations with one of the two tour companies (see Guided tour info). For guests of Kalaupapa residents, your sponsor is responsible for applying for a permit. Any persons who have not properly secured a permit into the settlement will not be admitted entrance. Children under the age of 16 are not allowed in Kalaupapa Settlement.	\N	\N
kaho	Kaloko-Honokōhau National Historical Park	To survive in a hot and arid environment the native Hawaiians (kanaka maoli) used ancient fishing skills, including the building of fishponds, and the knowledge of the location of precious fresh water (wai) that flows into the many brackish pools throughout the park. The spirit of the people (poe) and the knowledge of the elders (kupuna) created a tradition of respect and reverence for this area.	National Historical Park	HI	19.68083237	-156.0306932	Kaloko-Honokōhau National Historical Park is located on the west coast of the island of Hawai'i, approximately 3 miles south of the Keahole International Airport (Kailua-Kona AIrport) and 3 miles north of the town of Kailua-Kona, on the ocean side of Highway 19. The visitor center, Hale Ho'okipa, is located half a mile north of the entrance to Honokōhau Harbor. The Kaloko road gate is located across the highway from the Kaloko New Industrial Park (across from the big yellow "Kona Trade Center" building).	The weather in the park is typically hot and sunny, with temperatures in the upper 80's.	0.00	No Entrance Fees	\N	\N
katm	Katmai National Park & Preserve	A landscape is alive underneath our feet, filled with creatures that remind us what it is to be wild. Katmai was established in 1918 to protect the volcanically devastated region surrounding Novarupta and the Valley of Ten Thousand Smokes. Today, Katmai National Park and Preserve also protects 9,000 years of human history and important habitat for salmon and thousands of brown bears.	National Park & Preserve	AK	58.62235668	-155.0126574	Katmai National Park & Preserve is located on the northern Alaska Peninsula, northwest of Kodiak Island and southwest of Homer, Alaska. The park’s headquarters is in King Salmon, about 290 air miles southwest of Anchorage. Unlike most national parks in the United States, Katmai is almost exclusively accessed by plane or boat.	Located between the stormy north Pacific Ocean and the even stormier Bering Sea, the Katmai region is often a battleground between weather systems. When you visit, be prepared to encounter all types of weather. On average, wet and cool conditions predominate in spring, summer, and fall. Winters are drier and colder.	0.00	There is no entrance fee for Katmai.	\N	\N
kefj	Kenai Fjords National Park	At the edge of the Kenai Peninsula lies a land where the ice age lingers. Nearly 40 glaciers flow from the Harding Icefield, Kenai Fjords' crowning feature. Wildlife thrives in icy waters and lush forests around this vast expanse of ice. Sugpiaq people relied on these resources to nurture a life entwined with the sea. Today, shrinking glaciers bear witness to the effects of our changing climate.	National Park	AK	59.81804414	-150.106502	Kenai Fjords National Park is located just outside the town of Seward in south-central Alaska, 126 miles south of Anchorage. Even though the park is often inaccessible during the winter months, Seward is accessible year-round via the Seward Highway, a National Scenic Byway. Follow the Seward Highway (AK-1) south from Anchorage. It will become AK-9 around mile 35 (87 miles from Anchorage) with AK-1 heading to Homer and Kenai. Continue on AK-9 to Seward.	The weather Kenai Fjords is difficult to predict and can change rapidly. The area generally enjoys a relatively temperate maritime climate, primarily due to the influence of the Japanese current that flows through the Gulf of Alaska. Summer daytime temperatures range from the mid 40s to the low 70s (Fahrenheit). Overcast and cool rainy days are frequent. Winter temperatures can range from the low 30s to -20.	0.00	No entrance fees are charged at Kenai Fjords National Park	\N	\N
