waro	Washington-Rochambeau Revolutionary Route National Historic Trail	In 1781, General Rochambeau’s French Army joined forces with General Washington’s Continental Army to fight the British Army in Yorktown, Virginia. With the French Navy in support, the allied armies moved hundreds of miles to become the largest troop movement of the American Revolution. The effort and cooperation between the two sides led to a victory at Yorktown and secured American independence.	National Historic Trail	MA,RI,CT,NY,NJ,PA,DE,MD,VA,DC	40.0958204556845	-74.8563515108944	The Washington-Rochambeau Revolutionary Route National Historic Trail encompasses over 680 miles of land and water trails through Rhode Island, Massachusetts, Connecticut, New York, New Jersey, Pennsylvania, Delaware, Maryland, Washington D.C., and Virginia	With over 680 miles of land and water trails and hundreds of historical sites, there is a wide variety in weather. Please check with your favorite weather website before traveling.	0.00	There is no fee to explore the Washington-Rochambeau Revolutionary Route National Historic Trail, but fees may apply for sites and attractions along the trail. Visitors should contact sites individually for further information.	\N	\N
waba	Washita Battlefield National Historic Site	On November 27, 1868, Lt. Colonel George Armstrong Custer led the 7th US Cavalry on a surprise dawn attack on a Cheyenne village led by Peace Chief Black Kettle. The event was an example of the tragic clash of cultures that occurred during the Great Plains Wars. It is also a place of remembrance and reflection for those who died here.	National Historic Site	OK	35.62083963	-99.70445143	Washita Battlefield is located just west of Cheyenne in western Oklahoma approximately 130 miles west of Oklahoma City and 140 miles east of Amarillo, Texas; just 25 miles north of I-40 on State Highway 283. From Cheyenne head west on State Highway 47 for about 1 mile and then make a right on State Highway 47A. The visitor center will be on the right and the battlefield is about .5 miles past the visitor center on the right as well.	Weather in western Oklahoma can vary considerably. Winters can be mild to severe with ice storms being the biggest concern. Spring is usually short but pleasant although severe weather, including tornadoes, is still a possibility. Usually a strong breeze is associated with spring weather. Summers are brutally hot and visitors should be cautioned about spending any length of time in the heat. Falls are cool with a bitter wind.	0.00	There is no entrance fee to Washita Battlefield National Historic Site	\N	\N
wefa	Weir Farm National Historical Park	Visit the home and studio of America's most beloved Impressionist, J. Alden Weir, and walk in the footsteps of generations of world-class artists. Set amidst more than 60 acres of painterly woods, fields, and waterways, you’ll soon see why Weir described his home as the "Great Good Place." Weir’s farm is a national legacy to American Impressionism, the creative spirit, and historic preservation.	National Historical Park	CT	41.25886268	-73.45452542	If you are coming to Weir Farm National Historical Park as part of a group that will require three or more vehicles, please call in advance to arrange a group visit. Follow Route 7 the Branchville section of Ridgefield. Turn onto Route 102 West at a traffic light. Take 2nd left onto Old Branchville Road. Turn left at first stop sign onto Nod Hill Road. Follow Nod Hill Road one mile; continue straight after stop sign at Pelham Lane to 735 Nod Hill Road	Weir Farm’s grounds are open all year and each season offers a unique experience. For a comfortable visit please note the following information. Winter: Temperatures average from 20 F to 40 F. Storms and colder weather are possible. Spring: Temperatures average from 30 F to 70 F. Rain is common. Summer: Temperatures average from 60 F to 85 F. High humidity is common in July and August. Fall: Temperatures average from 35 F to 75 F. Foliage season runs from mid-September to mid-to-late October.	0.00	There is no fee to visit Weir Farm National Historical Park.	\N	\N
whis	Whiskeytown National Recreation Area	Whiskeytown Lake’s crystal-clear water is perhaps the most recognized feature of the park. However, water-based recreation is only a part of what the 42,000-acre Whiskeytown National Recreation Area has to offer. Visit waterfalls, hike through rugged mountains, explore California Gold Rush history, and observe post-fire ecology in action. Your national park is calling...	National Recreation Area	CA	40.61359941	-122.6022657	Car From Interstate 5, take the Highway 44 West exit toward Downtown Redding and Eureka. From Downtown Redding, follow Highway 299 west toward Eureka for approximately 8 miles to reach the Visitor Center. Plane Commercial air service is available to Redding California located approximately 16 miles from Whiskeytown. Rental vehicles are available.	Whiskeytown NRA is in a Mediterranean climate, which means hot, dry summers followed by cool, wet winters. Summer temperatures often reach the upper 90's to lower 100 degrees Fahrenheit, as well as the occasional thunderstorm. Winter brings snow to the upper elevations (only occasionally down to the lake level of 1,200'), and rain and ice. See the park weather page for the current weather.	15.00	This pass gives access to the park for one individual to enter on foot, by bicycle, or by public transit. It is valid for seven days and can be applied towards an Annual pass until it expires.	\N	\N
whsa	White Sands National Park	Rising from the heart of the Tularosa Basin is one of the world's great natural wonders - the glistening white sands of New Mexico. Great wave-like dunes of gypsum sand have engulfed 275 square miles of desert, creating the world's largest gypsum dunefield. White Sands National Park preserves a major portion of this unique dunefield, along with the plants and animals that live here.	National Park	NM	32.77907858	-106.3333461	White Sands National Park is located off of US Highway 70 between the cities of Las Cruces and Alamogordo. The park is about 15 miles west of Alamogordo and 52 miles east of Las Cruces.	Temperatures at White Sands vary greatly throughout the year. Summer time temperatures can be very hot. Winters are mild with cool evenings. Spring time is the windy season. Fall is very enjoyable with mild daytime and night time temperatures.	25.00	Per vehicle fee is charged to visitors for entry by a single, private non-commercial vehicle. Entrance fees are valid for reentry for seven consecutive days from the date of purchase.	\N	\N
whmi	Whitman Mission National Historic Site	The 1847 attack on the Whitmans horrified Americans and impacted the lives of the peoples of the Columbia Plateau for decades afterwards. Was killing the Whitmans justified legal retribution, an act of revenge, or some combination of both? The circumstances that surround this tragic event resonate with modern issues of cultural interaction and differing perspectives.	National Historic Site	WA	46.04119286	-118.4629388	The site can be reached from US Highway 12, 8 miles west of Walla Walla, Wa. Airports are located in Walla Walla (11 miles east of park), Pasco (43 miles west), and Pendleton, Oregon (46 miles south).	Summers are hot. Hats, water and sunblock are recommended. Winters are mild and rainy with a few snow storms. Layered clothing is advised.	0.00	None	\N	\N
wiho	William Howard Taft National Historic Site	High atop one of Cincinnati's most prominent hilltops stands the two-story Greek Revival house where William Howard Taft was born and grew up. Hard work, a good education, and an interest in civic duty are attributes that made the Taft family outstanding leaders over the years. The environment that shaped Taft's character and philosophy is highlighted on a visit to the site.	National Historic Site	OH	39.11970352	-84.50758951	From I-71 north; Take Exit 2 (Reading Road and Eden Park Drive). Stay in right lane; turn left at first stoplight onto Dorchester Avenue, and go to the top of the hill. Turn right on Auburn Avenue and go 1 ½ blocks to the site. Park will be on the right. From I-71S, take Exit 3 (Taft Road). Follow Taft Road westbound. Go 0.75 mile to Auburn Avenue. Turn left and go 0.5 mile to the site. Park will be on the left.	The park lies in a humid continental zone with a generally temperate climate. Winters are mildly cold with average temperatures around 48 degrees (F). Summers are hot and humid with an average temperature around 77 degrees (F). Average annual total rainfall is just under 40". Snowfall in the winter is generally light with an average total snowfall of less than 12"	0.00	There are no entrance fees to the park.	\N	\N
wicr	Wilson's Creek National Battlefield	Wilson's Creek was the first major Civil War battle fought west of the Mississippi River, and the site of the death of Nathaniel Lyon, the first Union general killed in action. The costly Southern victory on August 10, 1861, focused national attention on the war in Missouri. Wilson’s Creek NB commemorates and interprets the battle within the context of the war in the Trans-Mississippi West.	National Battlefield	MO	37.1000127	-93.40986704	From I-44: exit at Exit 70 (Missouri Highway MM). Continue south to U.S. Highway 60. Proceed through the intersection. Continue 1/2 mile to Missouri Highway ZZ. Turn right on ZZ. Continue south to Farm Road 182 (Elm Street). Turn left; the entrance to the battlefield is on the right. From U.S. Highway 65 (south of Springfield): turn left (west) on Missouri Highway 14 at Ozark. Continue on Highway 14 to Missouri Highway ZZ. Follow ZZ north to Farm Road 182. Turn right; the entrance is on the right.	Summer months are frequently hot and humid, with occasional showers and thunderstorms. Winter months (especially January and February) are frequently cold, with occasional ice and light snow. Spring and fall months are generally pleasant, with occasional showers.	10.00	Individual entrance is anyone walking or bicycling into the park and would be subject to paying an individual entrance to the park. Receipt is good for 7 days at Wilson's Creek National Battlefield.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nEntrance Fees Will Resume May 29th, 2021. When collected, fee is $10.00 for an adult walking or bicycling into the park. An adult is anyone 16 and older. Children 15 and under are free. Receipt is good for 7 days at Wilson’s Creek National Battlefield.	\N	\N
wica	Wind Cave National Park	Bison, elk, and other wildlife roam the rolling prairie grasslands and forested hillsides of one of America's oldest national parks. Below the remnant island of intact prairie sits Wind Cave, one of the longest and most complex caves in the world. Named for barometric winds at its entrance, this maze of passages is home to boxwork, a unique formation rarely found elsewhere.	National Park	SD	43.58012365	-103.4394709	Wind Cave National Park is located in South Dakota about 11 miles north of Hot Springs, or about 22 miles south of Custer, on US Highway 385. The park Visitor Center, where all cave tours begin, is approximately 1/2 mile west of the highway.	Spring: Highs range from 50-70°F with highly variable weather. Spring is the park's wettest season. Summer: Hot and generally dry with daytime temperatures regularly exceeding 80°F (27°C). Strong thunderstorms are common and can produce large hail and lightning. Fall: Generally dry with warm days and cool nights. Highs 50-60°F. Lows below freezing are common. Winter: Highs are in the high 30s with lows around 10°F. Snowfall averages 30 inches annually, periodically closing park roads.	0.00	There are no fees to drive through or hike in the park. Enjoy!	\N	\N
wing	Wing Luke Museum Affiliated Area	More than a museum, the Wing is an experience. A chance to truly understand what it was - and is - to be Asian American in the Pacific Northwest. Take a guided tour of a historic hotel and learn the inside story about what makes the local Chinatown-International District unique. Visitors explore thought-provoking exhibitions of real stories, including actor and martial arts master Bruce Lee.	Affiliated Area	WA	47.59820859	-122.3228912	The Wing Luke Museum is located in Seattle’s Chinatown-International District at 719 South King Street (between 7th and 8th Avenue South). It is accessible by foot, public transportation, and car.	Seattle has a temperate climate with average winter temperatures in the 50s and average summer temperatures in the 70s. Overcast skies and light rain are common from October through May.	17.00	Each general admission ticket includes all-day access to Museum galleries and Historic Hotel tour. \n\nFor admission rates and information on additional tours, please visit the Wing Luke website.	\N	\N
wotr	Wolf Trap National Park for the Performing Arts	No matter what your age or taste in shows, you'll find something you like onstage at Wolf Trap National Park for the Performing Arts. From May through September, multiple amphitheaters in the park present performances such as musicals, dance, opera, jazz, and popular and country music. A good time to explore the beauty and history of the park without the crowds is October - April.		VA	38.93854526	-77.265089	Wolf Trap National Park for the Performing Arts is located in Vienna, Virginia. The park can be accessed by traveling from Route 7, the Dulles Toll Road (Route 267), Beulah Road or Old Courthouse Road. For more detailed information visit the park's directions page.	The weather at Wolf Trap National Park for the Performing Arts is typical for the mid-Atlantic area. There are four seasons. The majority of visitation is during the summers, which can be hot and humid during the day and cooler at night.	0.00	There is no entrance fee at Wolf Trap National Park for the Performing Arts.	\N	\N
wori	Women's Rights National Historical Park	Women’s Rights National Historical Park tells the story of the first Women’s Rights Convention held in Seneca Falls, NY on July 19-20,1848. It is a story of struggles for civil rights, human rights, and equality, global struggles that continue today. The efforts of women’s rights leaders, abolitionists, and other 19th century reformers remind us that all people must be accepted as equals.	National Historical Park	NY	42.90817073	-76.81655558	From the New York State Thruway (I-90) take exit 41 (Route 414). Turn right onto Route 414 South after exiting the tollbooth. Follow Route 414 South for approximately four miles. At the intersections of Route 414 and Routes 5 & 20, turn left onto Route 5 & 20 East. Follow for approximately one and a half miles into the Village of Seneca Falls. The Visitor Center is on the left at 136 Fall Street, Seneca Falls, NY 13148.	In the winter, temperatures range from 0-40 degrees with an average of 10 inches of snow per month. Summer temperatures range from 60-85 degrees with high humidity.	0.00	Entrance and all events are free.	\N	\N
wwim	World War I Memorial	A grateful nation honors the service, valor, courage and sacrifice of the 4.7 million American sons and daughters who served in the Great War.		DC	38.8959	-77.0329	1493 Pennsylvania Avenue NW, Nearest Intersection: 15th St NW and Pennsylvania Ave NW	Washington DC gets to see all four seasons. Humidity will make the temps feel hotter in summer and colder in winter. Spring (March - May) Temp: Average high is 65.5 degrees with a low of 46.5 degrees Summer (June - August) Temp: Average high is 86 degrees with a low of 68.5 degrees Fall (September - November) Temp: Average high is 68 degrees with a low of 51.5 degrees Winter (December - February) Temp: Average high is 45 degrees with a low of 30 degrees (Source: www.usclimatedata.com)	0.00	There are no fees associated with visiting this site.	\N	\N
wwii	World War II Memorial	Through stone architecture and bronze sculptures, the World War II Memorial recognizes the ways Americans served, honors those who fell, and recognizes the victory they achieved to restore freedom and end tyranny around the globe.		DC	38.88923917	-77.0403759	GPS Coordinates: 38.889413, -77.040553 Address: 1750 Independence Ave. SW, Washington, D.C. Nearest Intersection: 17th St. & Independence Ave. SW	Washington DC gets to see all four seasons. Humidity will make the temps feel hotter in summer and colder in winter. Spring (March - May) Temp: Average high is 65.5 degrees with a low of 46.5 degrees Summer (June - August) Temp: Average high is 86 degrees with a low of 68.5 degrees Fall (September - November) Temp: Average high is 68 degrees with a low of 51.5 degrees Winter (December - February) Temp: Average high is 45 degrees with a low of 30 degrees (Source: www.usclimatedata.com)	0.00	No Entrance Fee	\N	\N
wrst	Wrangell - St Elias National Park & Preserve	Wrangell-St. Elias is a vast national park that rises from the ocean all the way up to 18,008 ft. At 13.2 million acres, the park is the same size as Yellowstone National Park, Yosemite National Park, and Switzerland combined! Within this wild landscape, people continue to live off the land as they have done for centuries. This rugged, beautiful land is filled with opportunities for adventure.	National Park & Preserve	AK	61.4182147	-142.6028439	The administrative building and main park visitor center are located along the Richardson Highway (Hwy 4), which is a paved state highway that runs through Copper Center, AK. The buildings are 8 miles south of the Glenn Highway and Richardson Highway intersection near Glennallen, Alaska. This is approximately 200 miles east of Anchorage, AK and 250 miles south of Fairbanks, AK.	Varies widely depending on location in park and time of year. Visit https://www.nps.gov/wrst/planyourvisit/weather.htm for detailed information.	0.00	Fee free park	\N	\N
wrbr	Wright Brothers National Memorial	Wind, sand, and a dream of flight brought Wilbur and Orville Wright to Kitty Hawk, North Carolina where, after four years of scientific experimentation, they achieved the first successful airplane flights on December 17, 1903. With courage and perseverance, these self-taught engineers relied on teamwork and application of the scientific process. What they achieved changed our world forever.	National Memorial	NC	36.01637713	-75.66997163	Wright Brothers National Memorial is located along US 158 in the town of Kill Devil Hills on the Outer Banks of North Carolina.	Weather on the Outer Banks varies seasonally and daily. Summers can be very hot and sunny (wear sunscreen and drink water), while winters can be cold and wet. High winds are always a possibility any time of the year. It is not uncommon for a brief winter snow each year. Being on a barrier island, the memorial is susceptible to storm impacts, including hurricanes in the summer and nor'easters in the winter. No matter what time of year you visit, dress for the weather, and be ready for wind!	10.00	The fee allows entrance to Wright Brothers National Memorial for one person, 16 years old or older, for seven consecutive days from the date of purchase.	\N	\N
wupa	Wupatki National Monument	Nestled between the Painted Desert and ponderosa highlands of northern Arizona, Wupatki is a landscape of legacies. Ancient pueblos dot red-rock outcroppings across miles of prairie. Where food and water seem impossible to find, people built pueblos, raised families, farmed, traded, and thrived. Today, if you linger and listen, earth and artifacts whisper their stories to us still.	National Monument	AZ	35.55741077	-111.3957216	Wupatki and Sunset Crater Volcano National Monuments are connected by loop road FR-545. Visitors can enter the loop road near mile markers 430 (Sunset Crater Volcano) and 444 (Wupatki) on U.S. Highway 89.	Be prepared for variable and extreme weather conditions. You may expect high winds any time of year, summer temperatures above 100ºF (38ºC), afternoon storms July–September, and occasional snow in winter and early spring. Dress in layers, as Wupatki weather can change quickly at any time of year.	25.00	This fee covers the occupants of one private vehicle for seven days at both Sunset Crater Volcano and Wupatki National Monuments.	\N	\N
yell	Yellowstone National Park	On March 1, 1872, Yellowstone became the first national park for all to enjoy the unique hydrothermal wonders. Today, millions of people come here each year to camp, hike, and enjoy the majesty of the park.	National Park	ID,MT,WY	44.59824417	-110.5471695	Yellowstone National Park covers nearly 3,500 square miles in the northwest corner of Wyoming (3% of the park is in Montana and 1% is in Idaho). Yellowstone has five entrance stations, and several are closed to regular vehicles during winter. It takes many hours to drive between these entrances, so be sure to check the status of roads at the entrance you intend to use while planning your trip and before you arrive.	Yellowstone's weather can vary quite a bit, even in a single day. In the summer, daytime highs can exceed 70°F (25°C), only to drop 20 or more degrees when a thunderstorm rolls through. It can snow during any month of the year, and winter lows frequently drop below 0°F (-18°C), especially at night. Bring a range of clothing options, including a warm jacket and rain gear, even in the summer.	35.00	Good for entry into Yellowstone National Park for seven days from the date of purchase.	\N	\N
york	Yorktown Battlefield Part of Colonial National Historical Park	Discover what it took for the United States to be independent as you explore the site of the last major battle of the Revolutionary War. Here at Yorktown, in the fall of 1781, General George Washington, with allied American and French forces, besieged General Charles Lord Cornwallis’s British army. On October 19, Cornwallis surrendered, effectively ending the war and ensuring independence.	Part of Colonial National Historical Park	VA	37.2195	-76.4983	For an internet map search or GPS, use the following: Yorktown Battlefield Visitor Center, 1000 Colonial Parkway, Yorktown, Virginia 23690. Eastbound from the Richmond area via I-64, exit 242B for Yorktown, to the Colonial Parkway. Follow the parkway to its end. West bound Interstate 64 from the Virginia Beach/Norfolk/Hampton area for Yorktown should take Route 105 East (Fort Eustis Boulevard east), exit 250B to Route 17. Turn left onto Route 17. Follow the signs to Yorktown Battlefield.	Yorktown, VA climate is warm during summer when temperatures tend to be in the 80's and cold during winter when temperatures tend to be in the 30's. The warmest month of the year is July with an average maximum temperature of 89.00 degrees Fahrenheit, while the coldest month of the year is January with an average minimum temperature of 28.10 degrees Fahrenheit. For closures in due to inclement weather at Colonial National Historical Park please phone this 24 hour phone number (757) 856-1240.	15.00	Yorktown Battlefield is part of Colonial National Historical Park. For information about park fees visit Colonial National Historical Park's Fee Page here.\nhttps://www.nps.gov/colo/planyourvisit/fees.htm	\N	\N
yose	Yosemite National Park	Not just a great valley, but a shrine to human foresight, the strength of granite, the power of glaciers, the persistence of life, and the tranquility of the High Sierra. First protected in 1864, Yosemite National Park is best known for its waterfalls, but within its nearly 1,200 square miles, you can find deep valleys, grand meadows, ancient giant sequoias, a vast wilderness area, and much more.	National Park	CA	37.84883288	-119.5571873	You can drive to Yosemite year-round and enter via Highways 41, 140, and 120 from the west. Tioga Pass Entrance (via Highway 120 from the east) is closed from approximately November through late May or June. Hetch Hetchy is open all year but may close intermittently due to snow. Please note that GPS units do not always provide accurate directions to or within Yosemite.	Yosemite National Park covers nearly 1,200 square miles (3,100 square km) in the Sierra Nevada, with elevations ranging from about 2,000 feet (600 m) to 13,000 ft (4,000 m). Yosemite receives 95% of its precipitation between October and May (and over 75% between November and March). Most of Yosemite is blanketed in snow from about November through May. (Yosemite Valley can be rainy or snowy in any given winter storm.)	35.00	This fee is valid for seven days.	\N	\N
yuho	Yucca House National Monument	Through a continuing tradition of public and private cooperation, Yucca House National Monument preserves one of the largest archeological sites in SW Colorado. The unexcavated nature of the site preserves its integrity and beauty for future generations of scientists and visitors. Experience a sense of discovery by visiting a site that has remained largely untouched for the past 800 years!	National Monument	CO	37.24778944	-108.6861274	•From Cortez, take Hwy. 491 south approximately 8 miles. •Take a right on MC County Road B (green sign), which is a dirt road one mile south of MC Road C. •Drive 0.8 miles, crossing a paved road (MC Road 21), and take the next dirt road on the right (before the farmhouse on the left). •Follow this road north and west for 1.4 miles, and head towards a white ranch house with a red roof on the west horizon. •Once at the ranch house, Yucca House NM is on the left side if the driveway.	Spring and Fall are mild with daytime temperatures ranging from 50 F to 80 F. Winter temperatures are below 50 F with occasional snowstorms. Summers are hot and dry, with highs in the 90s.	0.00	There is no entrance fee for Yucca House National Monument.	\N	\N
yuch	Yukon - Charley Rivers National Preserve	Located in Interior Alaska, Yukon-Charley Rivers offers exploration in a largely untouched landscape. Whether you float the mighty Yukon River or paddle the Charley River's whitewater, your memories will last a lifetime. Geology, cultural history, gold rush remnants, wildlife, and vast scenery will be a part of your experience. But, the strongest element will be solitude. Your adventure awaits.	National Preserve	AK	65.0935608	-142.7960021	Although there is no direct highway connection to Yukon-Charley Rivers National Preserve, visitors are able to access the preserve by either air travel from Fairbanks, or water or air travel from two small towns on the road system(Eagle and Circle), near the preserve boundaries.	The area that Yukon-Charley Rivers encompasses is generally classified as sub-arctic, with exceptionally cold winters, relatively warm summers, low annual precipitation, and generally high winds.	0.00	There is no entrance fee for Yukon-Charley Rivers National Preserve	\N	\N
zion	Zion National Park	Follow the paths where ancient native people and pioneers walked. Gaze up at massive sandstone cliffs of cream, pink, and red that soar into a brilliant blue sky. Experience wilderness in a narrow slot canyon. Zion’s unique array of plants and animals will enchant you as you absorb the rich history of the past and enjoy the excitement of present day adventures.	National Park	UT	37.29839254	-113.0265138	Zion National Park is located on State Route 9 in Springdale, Utah. You may drive yourself on all open park roads except the Zion Canyon Scenic Drive. During most of the year, the Scenic Drive is accessed by shuttle bus only. Shuttles are free and can be found at the Zion Canyon Visitor Center.	Zion is known for a wide range of weather conditions. Temperatures vary with changes in elevation and day/night temperatures may differ by over 30°F. In summer, temperatures in Zion National Park often exceed 100°F/38°C. Zion experiences monsoons from mid-July into September that result in an increased risk of flash floods. Always be aware of the threat of storms and lightning and be prepared for a wide range of weather conditions. Winters are generally mild.	35.00	Admits private, non-commercial vehicle (15 passenger capacity or less) and all occupants to Zion National Park, including both the Zion Canyon and Kolob Canyon areas.	\N	\N
